import React from 'react';
import BsNav from '../Containers/BsNav'; 
import '../styles/mainPage.css'; 
import pianoStairs from '../img/symphonicStepsMainLogo.png';

function MainPage() {
  return (
    <div className="MainPage-page">

      <BsNav />

      <div className="MainPage-content">
        <h1>Welcome to Symphonic Steps</h1>
        <div classname="image-container">
        <img src={pianoStairs} alt="symphonicStepsMainLogo" style={{alignSelf:'centre'}} width="1000"  />

        </div>
      </div>
    </div>
  );
}

export default MainPage;
